import React, {useState} from "react";
import Header from "./Header";
import "./Cart.css";
import ExampleImg from "../Assets/camera.jpg";
export default function Cart() {
    const [quantity, setQuantity] = useState(1);

    function handleQuantityChange() {
        setQuantity(parseInt(e.target()))
    }

    return(
        <>
            <Header/>
            <div className="cart-container">
                <h3>Your Items</h3>
                <ul className="product-list">
                    <li className="product">
                        <div className="card">
                            <img src={ExampleImg} className="product-img" alt="product image"/>
                                <div className="card-body">
                                    <h5 className="card-title">Product Name</h5>
                                    <div className="quantity-container">
                                        <p>Quantity</p>
                                        <select className="form-select" value={quantity} onChange={handleQuantityChange}>

                                        </select>
                                    </div>
                                    <p>Delete</p>
                                </div>
                        </div>
                    </li>
                </ul>


            </div>
        </>
    )
}
